import React, {Component} from 'react'

class StarshipList extends Component {
    render() {
        // console.log(this.props.ships)
        const shipList = this.props.ships.map((s, idx) => {
            return <link key={idx}
                        path=""
                    >{s}</link>
        })
        return (
            <div>
                <h2>Starships</h2>
                {shipList}
            </div>
        )
    }
}

export default StarshipList
